import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import CardList from "./components/CardList";
import Gambar from "./assets/images/gambared.jpg";
ReactDOM.render(
<React.StrictMode>
<App />
<CardList
name="muhedi"
nim="21120118120017"
kelompok="09"
isNameBold
image={Gambar}
/>
</React.StrictMode>,
document.getElementById("root")
);
